						var p3 = new ShapeUtils.Point(Math.ceil(pointObject.v3 * zoom), Math.ceil(pointObject.v4 * zoom));

						var curve = new Bezier(previousPoint.x, previousPoint.y, p.x, p.y, p2.x, p2.y, p3.x, p3.y);
						var curveLength = curve.length();
						var curvePosition = currentOffset;


						var segment = 1,
							ti = curvePosition / curveLength,
							arrivedPosition = null;
						while (curvePosition < curveLength && curveLength > decoratorMarkSize) {
							// first guess of the position 							
							if (arrivedPosition !== null) {
								ti += (1 - ti) * (decoratorLength) / (curveLength - arrivedPosition);
							} else {
								ti = curvePosition / curveLength;
							}

							// step size for binary search for correct position
							var step = 0.5 * (decoratorLength / curveLength);

							var split = curve.split(ti);
							arrivedPosition = split.left.length();


							var iterations = 0;
							// as long as we are not close enough the the correct distance, make a new estimate (maximum 15 guesses)
							while (Math.abs(arrivedPosition - curvePosition) > 1.5 && iterations < 15) {
								ti = ti + Math.sign(curvePosition - arrivedPosition) * step;
								step /= 2;
								var split = curve.split(ti);
								arrivedPosition = split.left.length();
								iterations++;
							}

							var point = curve.get(ti);
							var normal = curve.normal(ti);
							var theta = Math.PI + Math.atan2(normal.y, normal.x);

